{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8433eb/72/", "subtitle": "68.\u5b88\u308a\u306e\u751f\u8d04", "discourse": ["\u79c1\u306e\u6642\u8a08\u3082\u3053\u3053\u3067\u8cb7\u3063\u305f\u7269\u306a\u306e\u3002\u8155\u6642\u8a08\u4ee5\u5916\u3082\u53d6\u308a\u6271\u3063\u3066\u308b\u3057\u3001\u30c7\u30b6\u30a4\u30f3\u3082\u8c4a\u5bcc\u3060\u304b\u3089", "\u3078\u3047\u2026\u2026\u30f4\u30a3\u30aa\u3061\u3083\u3093\u3001\u3053\u306e\u8fba\u6765\u305f\u4e8b\u3042\u3063\u305f\u3093\u3060\u306d", "\u305d\u3046\u3001\u3063\u3066\u8a00\u3044\u305f\u3044\u6240\u3060\u3051\u3069\u3001\u5b9f\u306f\u521d\u3081\u3066\u306a\u306e\u3002\u79c1\u306e\u6642\u8a08\u3092\u9078\u3093\u3067\u304f\u308c\u305f\u306e\u306f\u30de\u30ea\u30f3\u3060\u304b\u3089", "\u3042\u3041\u3001\u305d\u3046\u3044\u3046\u4e8b", "\u3053\u308c\u306a\u3089\u9784\u306b\u3064\u3051\u308b\u304b\u3001\u30dd\u30b1\u30c3\u30c8\u306b\u5165\u308c\u3066\u304a\u304f\u304b\u51fa\u6765\u308b\u3067\u3057\u3087\u3046\uff1f", "\u624b\u304c\u5927\u304d\u3044\u304b\u3089\u3001\u3042\u3093\u307e\u308a\u5c0f\u3055\u3044\u3068\u4f7f\u3044\u96e3\u3044\u308f\u3088\u306d", "\u305d\u3046\u3060\u306d\u3047\u2026\u2026\u3067\u3082\u3001\u30f4\u30a3\u30aa\u3061\u3083\u3093\u304c\u9078\u3093\u3067\u304f\u308c\u305f\u306e\u306a\u3089\u5927\u4e8b\u306b\u3059\u308b", "\u305d\u3046\u3044\u3046\u4e8b\u3092\u8a00\u3063\u3066\u308b\u3093\u3058\u3083\u306a\u304f\u3066", "\u8cb4\u65b9\u304c\u4f7f\u3046\u7269\u306a\u3093\u3060\u304b\u3089\u3001\u3061\u3083\u3093\u3068\u4f7f\u3044\u6613\u3044\u7269\u3067\u306a\u3044\u3068\u30c0\u30e1\u3067\u3057\u3087\u3046", "\u4ffa\u306e\u624b\u306b\u5408\u308f\u305b\u305f\u3089\u51c4\u3044\u5927\u304d\u3055\u306b\u306a\u308b\u3068\u601d\u3046\u3088\uff1f", "\u307e\u3041\u2026\u2026\u305d\u3046\u3088\u306d", "\u30dd\u30b1\u30c3\u30c8\u306b\u5165\u308c\u3066\u53d6\u308a\u51fa\u3057\u6613\u3051\u308c\u3070\u305d\u308c\u3067\u5145\u5206\u3060\u3088\u3002\u5927\u304d\u3059\u304e\u3066\u3082\u56f0\u308a\u305d\u3046\u3060\u3057", "\u30e6\u30e9\u30f3\u3082\u3001\u6c17\u306b\u5165\u3063\u305f\u306e\u304c\u3042\u3063\u305f\u3089\u3061\u3083\u3093\u3068\u6559\u3048\u3066\u3088\u306d", "\u2026\u2026\u2026\u2026", "\u3046\u3093\u2026\u2026\u3058\u3083\u3042\u3001\u4e00\u7dd2\u306b\u9078\u307c\u3046\u304b", "\u305d\u3082\u305d\u3082\u4f7f\u3046\u306e\u306f\u30e6\u30e9\u30f3\u306a\u3093\u3060\u304b\u3089\u306d\uff1f", "\u30f4\u30a3\u30aa\u3061\u3083\u3093\u306e\u306f\u3069\u3093\u306a\u306e\uff1f", "\u79c1\uff1f\u79c1\u306f\u2026\u2026", "\u304a\u5b88\u308a\u306a\u3093\u3067\u3059\u3063\u3066", "\u2026\u2026\u3042\u3041\u3001\u305d\u308c\u3067", "\u826f\u304b\u3063\u305f\u306d\u3001\u30f4\u30a3\u30aa\u3061\u3083\u3093", "\u3048\u3047", "\u3069\u3046\u305b\u306a\u3089\u4ffa\u3082\u304a\u63c3\u3044\u306b\u3057\u305f\u304b\u3063\u305f\u3051\u3069\u3001\u6b62\u3081\u3068\u3053\u3046\u304b\u306a", "\u3048\u2026\u2026\u3042\u3041\u3001\u30e6\u30e9\u30f3\u304c\u4f7f\u3046\u306b\u306f\u5c11\u3057\u5c0f\u3055\u3044\u304b\u3057\u3089", "\u305d\u3046\u3082\u3042\u308b\u3051\u3069\u2026\u2026\u3046\u3093\u3001\u5225\u306e\u306b\u3059\u308b", "\u2026\u2026\uff1f", "\u30e6\u30e9\u30f3\u306b\u4f3c\u5408\u3046\u3068\u601d\u3046\u7269\u306f\u6ca2\u5c71\u3042\u308b\u3051\u3069\u2026\u2026\u3053\u308c\u3063\u3066\u601d\u3046\u306e\u304c\u4e2d\u3005\u306a\u3044\u308f\u306d", "\u30f4\u30a3\u30aa\u3061\u3083\u3093\u304c\u9078\u3093\u3067\u304f\u308c\u308b\u306a\u3089\u4f55\u3067\u3082\u5b09\u3057\u3044\u3051\u3069\u306d\u3047", "\u305d\u3046\u3044\u3046\u4e8b\u3092\u8a00\u3063\u3066\u308b\u3093\u3058\u3083\u306a\u304f\u3066\u3001\u3069\u3046\u305b\u306a\u3089\u8cb4\u65b9\u306e\u597d\u307f\u306b\u3042\u3063\u305f\u7269\u304c\u826f\u3044\u3058\u3083\u306a\u3044", "\u30e6\u30e9\u30f3\u3001\u3061\u3083\u3093\u3068\u805e\u3044\u3066\u308b\uff1f", "\u805e\u3044\u3066\u308b\u3088\u30fc", "\u305d\u306e\u8fd4\u4e8b\u306f\u805e\u3044\u3066\u306a\u3044\u6642\u3088\u3001\u3082\u3046\u2026\u2026\u597d\u304d\u306a\u306e\u3001\u7121\u3044\u306e\uff1f", "\u3093\u30fc\u3001\u4ffa\u306f\u4f7f\u3044\u6613\u3055\u91cd\u8996\u3060\u304b\u3089\u3001\u30c7\u30b6\u30a4\u30f3\u3067\u9078\u3076\u3063\u3066\u306a\u308b\u3068\u2026\u2026", "\u3042\u2026\u2026", "\u30f4\u30a3\u30aa\u3061\u3083\u3093\u2026\u2026\uff1f", "\u3084\u3063\u3071\u308a\u2026\u2026", "\u3069\u3046\u3057\u305f\u306e\uff1f", "\u3053\u308c\u3001\u79c1\u306e\u6642\u8a08\u3060\u308f", "\u2026\u2026\uff1f", "\u306a\u308b\u307b\u3069\u2026\u2026\u78ba\u304b\u306b\u3001\u30f4\u30a3\u30aa\u3061\u3083\u3093\u306e\u6642\u8a08\u3060\u306d", "\u6025\u306b\u3054\u3081\u3093\u306a\u3055\u3044\u3001\u76ee\u306b\u5165\u3063\u305f\u304b\u3089\u3064\u3044\u2026\u2026", "\u3046\u3046\u3093\u3001\u6c17\u306b\u3057\u306a\u3044\u3067", "\u306d\u3001\u30f4\u30a3\u30aa\u3061\u3083\u3093\u3002\u4ffa\u3053\u308c\u306b\u3059\u308b", "\u3048\u3001\u3063\u3068\u2026\u2026", "\u4ffa\u3078\u306e\u3054\u8912\u7f8e\u3001\u3053\u308c\u304c\u3044\u3044", "\u3053\u308c\u3001\u4ffa\u306e\u304a\u5b88\u308a\u306b\u3059\u308b", "\u3054\u5229\u76ca\u3042\u308b\u304b\u3057\u3089\u2026\u2026", "\u3042\u308b\u3088\u30fc\u3002\u3053\u308c\u306a\u3089\u4ffa\u3001\u7d76\u5bfe\u306a\u304f\u3055\u306a\u3044\u3057\u5fd8\u308c\u306a\u3044\u81ea\u4fe1\u3042\u308b\u3082\u3093", "\u305d\u308c\u306f\u3054\u5229\u76ca\u306a\u306e\uff1f", "\u8cb4\u65b9\u304c\u6c17\u306b\u5165\u3063\u305f\u306e\u306a\u3089\u3001\u305d\u308c\u304c\u4e00\u756a\u3060\u3082\u306e\u306d", "\u3046\u3093\u3001\u3042\u308a\u304c\u3068\u3046\uff01"]}
{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8433eb/71/", "subtitle": "67.\u751f\u6daf\u767d\u65d7", "discourse": ["\u3093\u30fc\u2026\u2026\u4f55\u304b\u89e3\u653e\u611f\u304c\u51c4\u3044\u306d\u3047", "\u672c\u756a\u307e\u3067\u304c\u9577\u304b\u3063\u305f\u3082\u306e", "\u305d\u308c\u3067\u3001\u884c\u304d\u305f\u3044\u6240\u306f\u6c7a\u307e\u3063\u305f\u306e\uff1f", "\u4e00\u5fdc\u306f\u2026\u2026\u305f\u3060\u3053\u308c\u304c\u6b32\u3057\u3044\uff01\u307f\u305f\u3044\u306a\u306e\u306f\u307e\u3060\u3060\u304b\u3089\u3001\u3076\u3089\u3076\u3089\u3057\u306a\u304c\u3089\u8272\u3005\u3068\u898b\u3088\u3046\u304b\u306a\u3063\u3066", "\u52ff\u8ad6\u3088", "\u4f7f\u3063\u3066\u308b\u30d5\u30a1\u30a4\u30eb\u304c\u8349\u81e5\u308c\u3066\u6765\u305f\u304b\u3089\u3001\u4fee\u7e55\u983c\u3082\u3046\u304b\u306a\u3068\u601d\u3063\u3066", "\u3042\u3041\u2026\u2026\u305d\u3046\u3044\u3048\u3070\u3001\u524d\u306b\u898b\u305f\u6642\u8272\u3093\u306a\u6240\u304c\u89e3\u308c\u3066\u305f\u308f\u306d", "\u4e2d\u7b49\u90e8\u5165\u5b66\u306e\u6642\u304b\u3089\u4f7f\u3063\u3066\u308b\u304b\u3089\u306d\u3047", "\u8272\u3005\u8003\u3048\u3066\u305f\u6642\u306b\u6c17\u4ed8\u3044\u3066\u3055\u3002\u4ed6\u306b\u3082\u30da\u30f3\u306e\u30a4\u30f3\u30af\u3068\u304b\u3001\u76f4\u3057\u305f\u308a\u88dc\u5145\u3057\u305f\u308a\u3057\u306a\u304d\u3083\u3044\u3051\u306a\u3044\u306e\u306f\u3042\u3063\u305f\u3093\u3060\u3051\u3069\u3001\u65b0\u3057\u304f\u6b32\u3057\u3044\u3082\u306e\u3063\u3066\u306e\u306f\u306a\u304f\u3066", "\u305d\u3046\u306d\u2026\u2026\u79c1\u3082\u4eca\u601d\u3044\u51fa\u3057\u305f", "\u5bff\u547d\u304c\u6765\u3066\u308b\u306e\u3068\u304b\u306f\u4eca\u306e\u6240\u306a\u3044\u3057\u2026\u2026\u4eca\u65e5\u306f\u76f4\u3057\u56de\u3063\u3066\u7d42\u308f\u3063\u3061\u3083\u3046\u304b\u3082", "\u305d\u308c\u306a\u3089\u305d\u308c\u3067\u697d\u3057\u3044\u3093\u3058\u3083\u306a\u3044\uff1f", "\u30f4\u30a3\u30aa\u3061\u3083\u3093\u304c\u826f\u3044\u306a\u3089\u3044\u3044\u3051\u3069", "\u2026\u2026\u3053\u308c\u3067\u5168\u90e8\u304b\u306a", "\u601d\u3063\u305f\u3088\u308a\u5c11\u306a\u304b\u3063\u305f\u308f\u306d", "\u305d\u3046\uff1f\u307e\u3041\u5143\u3005\u8377\u7269\u5c11\u306a\u3044\u3057", "\u30f4\u30a3\u30aa\u3061\u3083\u3093\u3001\u6642\u9593\u3069\u3046\uff1f", "\u3048\uff1f\u3048\u3001\u3063\u3068\u2026\u2026\u307e\u3060\u5c11\u3057\u65e9\u3044\u304b\u3057\u3089", "\u305d\u3063\u304b\u3041\u2026\u2026\u3069\u3063\u304b\u3067\u4f11\u61a9\u3067\u3082\u3059\u308b\uff1f", "\u2026\u2026\u306d\u3047\u3001\u30e6\u30e9\u30f3\u3002\u3042\u306a\u305f\u6642\u8a08\u306f\u3069\u3046\u3057\u305f\u306e\uff1f", "\u3048\uff1f\u2026\u2026\u3042\u3041\u3001\u3053\u306e\u9593\u306a\u304f\u3057\u3061\u3083\u3063\u3066", "\u79c1\u306e\u8a18\u61b6\u306b\u3088\u308c\u3070\u3001\u3053\u308c\u3067\u56db\u3064\u76ee\u3058\u3083\u306a\u304b\u3063\u305f\uff1f", "\u6b8b\u5ff5\u3001\u516d\u3064\u76ee\u3067\u3059", "\u4f59\u8a08\u30c0\u30e1\u3088", "\u5206\u304b\u3063\u3066\u308b\u3051\u3069\u30fc\u2026\u2026\u8155\u6642\u8a08\u82e6\u624b\u306a\u3093\u3060\u3082\u3093", "\u3069\u3046\u3082\u3042\u306e\u3001\u624b\u9996\u304c\u7aae\u5c48\u306a\u306e\u304c\u30c0\u30e1\u306a\u3093\u3060\u3088\u306d\u3047\u3002\u52d5\u304b\u3057\u96e3\u3044\u3057\u3001\u30b5\u30a4\u30ba\u5408\u308f\u305b\u3066\u3082\u7de0\u3081\u4ed8\u3051\u3089\u308c\u3066\u308b\u611f\u3058\u304c\u3059\u308b", "\u6c17\u6301\u3061\u306f\u5206\u304b\u308b\u3051\u3069\u3001\u7121\u3044\u3068\u56f0\u308b\u3067\u3057\u3087\u3046\uff1f", "\u5b66\u5712\u5185\u3067\u306f\u5168\u7136\u3002\u5916\u306b\u3044\u308b\u6642\u306f\u3061\u3087\u3063\u3068\u3060\u3051", "\u3084\u3063\u3071\u308a", "\u30e6\u30e9\u30f3\u624b\u9996\u304c\u592a\u3044\u304b\u3089\u3001\u4f59\u8a08\u306b\u7aae\u5c48\u306b\u611f\u3058\u308b\u306e\u304b\u3057\u3089\u2026\u2026", "\u79c1\u3082\u8155\u6642\u8a08\u306f\u82e6\u624b\u3060\u3051\u3069\u2026\u2026\u3042", "\u2026\u2026\uff1f", "\u305d\u3063\u304b\u3001\u305d\u3046\u3088\u306d\u2026\u2026", "\u30f4\u30a3\u30aa\u3061\u3083\u30fc\u3093\uff1f\u3069\u3046\u3057\u305f\u306e\uff1f", "\u30f4\u30a3\u30aa\u3001\u3061\u3083\u3093\uff1f", "\u30e6\u30e9\u30f3\u306f\u304a\u8179\u7a7a\u3044\u3066\u308b\uff1f\u75b2\u308c\u305f\u304b\u3057\u3089\uff1f", "\u3046\u3046\u3093\u3001\u4ffa\u306f\u5e73\u6c17\u3060\u3051\u3069\u2026\u2026", "\u306a\u3089\u3001\u6c7a\u307e\u308a\u306d", "\u3048\u3001\u4f55\u304c\u2500\u2500\u3063", "\u30f4\u30a3\u30aa\u3061\u3083\u3093\u3001\u884c\u304d\u305f\u3044\u6240\u3067\u3082\u3042\u3063\u305f\u306e\uff1f", "\u30e6\u30e9\u30f3\u3078\u306e\u3054\u8912\u7f8e\u3001\u8cb7\u3044\u306b\u884c\u304f\u306e\u3088"]}
