{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8433eb/67/", "subtitle": "\u3010\u756a\u5916\u7de8\u3011\u30af\u30ea\u30b9\u30de\u30b9\u5f8c\u7de8", "discourse": ["\u30f4\u30a3\u30aa\u3061\u3083\u3093\u3001\u898b\u3064\u3051\u305f\u2026\u2026\u3063\uff01", "\u30e6\u30e9\u30f3\u2026\u2026", "\u30f4\u30a3\u30aa\u3061\u3083\u3093\u306f\u3001\u304b\u304f\u308c\u3093\u307c\u304c\u5f97\u610f\u3060\u306d\u3002\u4e00\u676f\u63a2\u3057\u305f\u3093\u3060\u3088", "\u305d\u3046\u8a00\u3044\u306a\u304c\u3089\u3001\u3044\u3064\u3082\u79c1\u3092\u898b\u3064\u3051\u308b\u306a\u3001\u30e6\u30e9\u30f3\u306f", "\u3048\u3078\u3078\u2026\u2026", "\u30f4\u30a3\u30aa\u3061\u3083\u3093\u3001\u9854\u8272\u3001\u60aa\u3044\u2026\u2026\u5927\u4e08\u592b\uff1f", "\u2026\u2026\u3042\u3041\u3001\u5927\u4e08\u592b", "\u306d\u3047\u3001\u30f4\u30a3\u30aa\u3061\u3083\u3093\u2026\u2026\u4eca\u65e5\u304c\u4f55\u306e\u65e5\u304b\u77e5\u3063\u3066\u308b\uff1f", "\u4eca\u65e5\u2026\u2026\uff1f", "\u3046\u3093\u3002\u4eca\u65e5\u306f\u3001\u30af\u30ea\u30b9\u30de\u30b9\u306a\u3093\u3060\u3088", "\u52ff\u8ad6\u3001\u77e5\u3063\u3066\u3044\u308b\u3088", "\u30af\u30ea\u30b9\u30de\u30b9\u306b\u306f\u3001\u30b5\u30f3\u30bf\u3055\u3093\u304c\u6765\u308b\u3093\u3060\u3063\u3066\u3002\u826f\u3044\u5b50\u306b\u3057\u3066\u305f\u3089\u3001\u30b5\u30f3\u30bf\u3055\u3093\u304c\u5e78\u305b\u3092\u904b\u3093\u3067\u304d\u3066\u304f\u308c\u308b\u3063\u3066", "\u3042\u3041\u2026\u2026\u305d\u3046\u3060\u306d", "\u3060\u304b\u3089\u3001\u306d\u2026\u2026\u306f\u3044\u3063\uff01", "\u2026\u2026\u2026\u2026\u3047\uff1f", "\u3048\u3001\u3063\u3068\u2026\u2026\u3053\u308c\u306f\u2026\u2026\uff1f", "\u30f4\u30a3\u30aa\u3061\u3083\u3093\u3078\u3001\u4ffa\u304b\u3089\u306e\u30af\u30ea\u30b9\u30de\u30b9\u30d7\u30ec\u30bc\u30f3\u30c8", "\u2500\u2500\u2500\u2500", "\u30b5\u30f3\u30bf\u30