{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8433eb/29/", "subtitle": "27.\u304a\u697d\u3057\u307f", "discourse": ["\u30f4\u30a3\u30aa\u30ec\u30c3\u30c8\u69d8\u3001\u4f55\u304b\u826f\u3044\u4e8b\u3067\u3082\u3042\u308a\u307e\u3057\u305f\u304b\uff1f", "\u3048\u2026\u2026\uff1f", "\u4f55\u3060\u304c\u4eca\u65e5\u306f\u6a5f\u5acc\u304c\u5b9c\u3057\u3044\u69d8\u3067\u3057\u305f\u306e\u3067\u3002\u5e30\u5b85\u3057\u305f\u6642\u3082\u3001\u3044\u3064\u3082\u3088\u308a\u8868\u60c5\u304c\u67d4\u3089\u304b\u304b\u3063\u305f\u69d8\u306b\u304a\u898b\u53d7\u3051\u3057\u307e\u3057\u305f", "\u305d\u3046\u3001\u3060\u3063\u305f\u304b\u3057\u3089\u2026\u2026", "\u2026\u2026\u78ba\u304b\u306b\u3001\u826f\u3044\u4e8b\u3060\u3063\u305f\u306e\u304b\u3082\u3057\u308c\u306a\u3044\u308f", "\u2026\u2026\u30e6\u30e9\u30f3\u3068\u3001\u7d04\u675f\u3092\u3057\u305f\u304b\u3089\u304b\u3057\u3089", "\u30e6\u30e9\u30f3\u69d8\uff1f", "\u3048\u3047\u3001\u660e\u65e5\u306e\u653e\u8ab2\u5f8c\u4e00\u7dd2\u306b\u51fa\u639b\u3051\u308b\u4e8b\u306b\u306a\u3063\u305f\u306e\u3002\u5bc4\u308a\u9053\u306a\u3093\u3066\u3057\u305f\u4e8b\u304c\u306a\u304b\u3063\u305f\u304b\u3089\u3001\u6d6e\u304b\u308c\u3066\u3057\u307e\u3063\u305f\u306e\u306d", "\u3067\u3082\u307e\u3055\u304b\u3001\u305d\u3093\u306a\u306b\u697d\u3057\u307f\u306b\u3057\u3066\u3044\u305f\u306a\u3093\u3066\u2026\u2026\u3075\u3075\u3063\u3001\u30de\u30ea\u30f3\u306b\u8a00\u308f\u308c\u308b\u307e\u3067\u6c17\u4ed8\u304b\u306a\u304b\u3063\u305f\u308f", "\u3060\u304b\u3089\u660e\u65e5\u306f\u5e30\u308a\u304c\u5c11\u3057\u9045\u3044\u304b\u3068\u601d\u3046\u3051\u308c\u3069\u3001\u5fc3\u914d\u3057\u306a\u3044\u3067", "\u304b\u3057\u3053\u307e\u308a\u307e\u3057\u305f\u2026\u2026\u30f4\u30a3\u30aa\u30ec\u30c3\u30c8\u69d8", "\u3093\u2026\u2026\uff1f", "\u2026\u2026\u697d\u3057\u3093\u3067\u3001\u3044\u3089\