{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n8433eb/3/", "subtitle": "01.\u4e8c\u5ea6\u76ee\u306e\u59c9\u59b9\u306f\u4ed6\u4eba\u306b\u306a\u308a\u305f\u3044", "discourse": ["\u30f4\u30a3\u30aa\u30ec\u30c3\u30c8\u69d8\u2026\u2026\u5927\u4e08\u592b\u3067\u3059\u304b\uff1f", "\u3048\u3047\u2026\u2026\u5c11\u3057\u75b2\u308c\u305f\u3060\u3051\u3088", "\u30db\u30c3\u30c8\u30df\u30eb\u30af\u3092\u304a\u6301\u3061\u3057\u307e\u3059\u3001\u6c17\u6301\u3061\u304c\u843d\u3061\u7740\u304d\u307e\u3059\u304b\u3089", "\u306f\u3041\u2026\u2026", "\u30f4\u30a3\u30aa\u30ec\u30c3\u30c8\u69d8\u3001\u304a\u6301\u3061\u3057\u307e\u3057\u305f\u3088", "\u3042\u308a\u304c\u3068\u3046\u3001\u30de\u30ea\u30f3\u2026\u2026\u3042\u3041\u3001\u6e29\u304b\u3044\u308f", "\u2026\u2026\u3084\u3063\u3071\u308a\u75b2\u308c\u3066\u3044\u308b\u307f\u305f\u3044\u3002\u4eca\u65e5\u306f\u3082\u3046\u4f11\u3080\u308f", "\u3067\u306f\u304a\u7740\u66ff\u3048\u306e\u304a\u624b\u4f1d\u3044\u3092", "\u81ea\u5206\u3067\u3084\u308b\u308f\u2026\u2026\u3054\u3081\u3093\u306a\u3055\u3044\u3001\u4e00\u4eba\u306b\u306a\u308a\u305f\u3044\u306e", "\u2026\u2026\u754f\u307e\u308a\u307e\u3057\u305f"]}
